tart = time.time()\n            z = df.x + 1 + 2 - df.y\n            z.sum().compute()\n            stop = time.time()\n            simple.append(stop - start)\n        simple = np.array(simple)\n\n    df2 = None\n    with performance_report(filename=f\"{today}-shuffle-scheduler.html\"):\n        shuffle_t = []\n        # print('start shuffle: ', flush=True)\n        for i in range(iterations):\n            client.cancel(df2)\n            start = time.time()\n            # shuffle(df, \"id\", shuffle=\"tasks\")\n            df2 = df.set_index(\"id\").persist()\n            wait(df2)\n            stop = time.time()\n            shuffle_t.append(stop - start)\n        shuffle_t = np.array(shuffle_t)\n\n    with performance_report(filename=f\"{today}-rand-access-scheduler.html\"):\n        rand_access = []\n        for i in range(iterations):\n            start = time.time()\n            df2.head()\n            stop = time.time()\n            rand_access.append(stop - start)\n        rand_access = np.array(rand_access)\n    return dict(simple=simple, shuffle=shuffle_t, rand_access=rand_access)\n\n        &lt;/pre&gt;\n        "},"id":"1210","type":"Div"},{"attributes":{},"id":"1136","type":"ResetTool"},{"attributes":{},"id":"1274","type":"UnionRenderers"},{"attributes":{"axis":{"id":"1118"},"ticker":null,"visible":false},"id":"1121","type":"Grid"},{"attributes":{"color_mapper":{"id":"1146"},"formatter":{"id":"1171"},"label_standoff":12,"location":[0,0],"ticker":{"id":"1173"}},"id":"1170","type":"ColorBar"},{"attributes":{"formatter":{"id":"1237"},"ticker":{"id":"1082"},"visible":false},"id":"1081","type":"LinearAxis"},{"attributes":{"source":{"id":"1106"}},"id":"1131","type":"CDSView"},{"attributes":{"months":[0,2,4,6,8,10]},"id":"1258","type":"MonthsTicker"},{"attributes":{},"id":"1275","type":"Selection"},{"attributes":{"data":{"bandwidth":[],"bandwidth-half":[],"bandwidth_text":[],"type":[]},"selected":{"id":"1277"},"selection_policy":{"id":"1276"}},"id":"1178","typ
